import Link from "next/link";

export default function LeetCodeList({posts}){
    return (
        <ul>
            {posts.map((item, index) => {
                return <li key={index}>
                    <Link as={`/post/${slug}`} href="/post/[...slug]">
                        <a className="hover:underline">{item.slug}</a>
                    </Link>
                </li>
            })}
        </ul>
    )
}
